import {Switch, Route} from 'react'
import DetailedVideoContent from './DetailedVideoContent'
import {VideoDetails} from 'react-native-web'

const redirectPage = () => {
  <Switch>
    <Route exact path='/' component={DetailedVideoContent}></Route>
  </Switch>
}

const Video = (props) => {
    const video_url  = props.video_url;

    return (
      <div className="videoContent">
        <video width="500" height="290" controls>
          <source type="video/mp4" src={video_url.slice(0,25) + "uc?export=view&id=" + video_url.slice(32,65)}></source>
        </video>
      
        <button id='view-VideoDetails' onClick={redirectPage}>View Details</button>
      </div>
    )
}

export default Video
